import React, { FC } from 'react';
import ItemProduct from './ItemProduct';
import { useQuery } from 'react-query';
import { productService } from '../../../services';
import { foodType } from '../../../types';

interface ItemViewProductProps {
  storeOne: boolean;
  storeTwo: boolean;
  storeTree: boolean;
}

const ItemViewProduct: FC<ItemViewProductProps> = ({ storeOne, storeTwo, storeTree }) => {


const pizzaDay :foodType[] = [
  {
  food_id: 1,
  food_name:'Pepperoni',
  food_price:145,
  food_img:'https://pizzaday.eatery.club/storage/pizzaday/product/icon/1344/26f343c40875959617a836ebad4cf0ff.jpg',
  },
  {
    food_id: 2,
    food_name:'Margarita',
    food_price:64,
    food_img:'https://pizzaday.eatery.club/storage/pizzaday/product/icon/8299/conversions/27b10a3aeee2e3e0c4930b22ff4c9156-optimized.jpg',
  }
]

const iqPizza = {
  0:{
  food_id: 3,
  food_name:'Salami White',
  food_price:85,
  food_img:'https://iq-pizza.eatery.club/storage/iq-pizza/product/icon/18223/conversions/text-optimized.jpg',
  },
  1:{
    food_id: 4,
    food_name:'Francesca',
    food_price:120,
    food_img:'https://www.kfc-ukraine.com/admin/files/4179.png',

  }
}
const  kfc = {
  0:{
  food_id: 5,
  food_name:'Salsa Burger',
  food_price:90,
  food_img:'https://www.kfc-ukraine.com/admin/files/4176.png',
  },
  1:{
  food_id: 6,
  food_name:'Takos Sirnia',
  food_price:45,
  food_img:'https://www.kfc-ukraine.com/admin/files/4176.png',
  },
}


  // const { data: pizzaDay, isLoading: isLoadingPizzaDay } = useQuery('PizzaDay', () => {
  //   return productService.getPizzaDay();
  // });

  // const { data: kfc, isLoading: isLoadingKFC } = useQuery('KFC', () => {
  //   return productService.getKFC();
  // });

  // const { data: iqPizza, isLoading: isLoadingIQpizza } = useQuery('IQpizza ', () => {
  //   return productService.getIQpizza();
  // });

  return (
    <div className='mt-6 grid space-x-5 grid-cols-1 gap-x-6 gap-y-10 sm:grid-cols-2 lg:grid-cols-4 xl:gap-x-8'>


    {storeOne && Array.isArray(pizzaDay) ? (
        pizzaDay.map((product: foodType, id: number) => <ItemProduct key={id} product={product} />)
      ) : (
        <></>
      )}

      {storeTwo && Array.isArray(iqPizza) ? (
        iqPizza.map((product: foodType, id: number) => <ItemProduct key={id} product={product} />)
      ) : (
        <></>
      )}

     {storeTree && Array.isArray(kfc) ? (
        kfc?.map((product: foodType, id: number) => <ItemProduct key={id} product={product} />)
      ) : (
        <></>
      )}
    </div>
  );
};

export default ItemViewProduct;
